import React from "react";

class Titulo extends React.Component{
    constructor(props) {
        super(props);
        this.saludo = props.text.saludo
        this.despedida = props.text.despedida
    }

    
    render(){
        let saludo = this.saludo
        let despedida= this.despedida
        return(
        <>
            <h1>{despedida}</h1>
            {console.log(this.saludo)}
        </>
        
        )
    }
}

export default Titulo
